	/**
	 * json字符串到Map转换
	 * @param str
	 * @return
	 */
	public static Map<String, Object> json2Map(String json) {
		Map<String, Object> map = new HashMap<String, Object>();
		if(null==json || json.trim().length()<=0) return map;
		com.alibaba.fastjson.JSONObject jsonObj = com.alibaba.fastjson.JSONObject.parseObject(json);
		Iterator<String> keys = jsonObj.keySet().iterator();
		while (keys.hasNext()) {
			String key = (String) keys.next();
			String value = jsonObj.get(key).toString();
			if(value.startsWith("[") && value.endsWith("]")){
				com.alibaba.fastjson.JSONArray jsonArr = com.alibaba.fastjson.JSONArray.parseArray(value);
				List<Map<String, Object>> lstMap = produceJSONArray2List(jsonArr);
				map.put(key, lstMap);
			}
			else if (value.startsWith("{") && value.endsWith("}")) {
				map.put(key, json2Map(value));
			} else {
				map.put(key, value);
			}
		}
		return map;
	}
	/**
	 * 将键值对数组转换成List
	 * @param jsonArr
	 * @return
	 */
	public static List<Map<String, Object>> produceJSONArray2List(com.alibaba.fastjson.JSONArray jsonArr){
		List<Map<String, Object>> lstMap = new ArrayList<Map<String, Object>>();
		try {
			for (Object o : jsonArr) {
				com.alibaba.fastjson.JSONObject jsonObj = (com.alibaba.fastjson.JSONObject) o;
				String str = jsonObj.toJSONString();
				Map<String, Object> map = json2Map(str);
				lstMap.add(map);
			}
		} catch (Exception e) {
			// TODO: handle exception
		}
		
		return lstMap;
	}
	
