	public static void parseExcel(){
		Map<String, Map<String, Object>> map2Map = new HashMap<String, Map<String, Object>>();
		Map<String, Object> map2 = new HashMap<String, Object>();
		Map<String, Object> tmpMap = new HashMap<String, Object>();
		
		try {
		    String filepath = "resources/列车时刻表.xls";// c:\\列车时刻表.xls
			Workbook book = Workbook.getWorkbook(new File(filepath));
			
			// 获得第一个工作表对象
//			Sheet sheet = book.getSheet(0);
			// 得到工作簿所有的工作表对象
			Sheet[] sheets = book.getSheets();
			for(int s = 0; s < 6; s++){
				map2 = new HashMap<String, Object>();
				Sheet sheet = sheets[s];
				// 遍历所有行（第一行为标题）
				for (int i = 1; i < sheet.getRows(); i++) {
					tmpMap = new HashMap<String, Object>();
					Cell[] cells = sheet.getRow(i);//获得第n行的所有列
					if(null !=cells && cells.length>0){
						for (int j = 0; j < cells.length; j++) {
							String title = sheet.getRow(0)[j].getContents();
							tmpMap.put((String)map.get(title), cells[j].getContents());
							System.out.print(cells[j].getContents() + " ");
						}
						System.out.println();
						
						String station2station = cells[3].getContents()+"-"+cells[4].getContents();
						map2.put(station2station, tmpMap);
						log.info(station2station);
					}
				}
				
				String trainCode = sheet.getName();
				map2Map.put(trainCode, map2);
			}
			
//			System.err.println(net.sf.json.JSONObject.fromObject(map2Map));
			System.err.println(JSONObject.toJSONString(map2Map));
			book.close();
		}
		catch (Exception e) {
			e.printStackTrace();
		}
	}
	
